// src/Components/Header.tsx
import React from 'react';

const Header: React.FC = () => {
  return (
    <header className="bg-gradient-to-r from-teal-500 to-teal-600 p-4 text-white shadow-md">
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-3xl font-extrabold">Mi Aplicación en React con TypeScript</h1>
        <nav>
          <ul className="flex space-x-8">
            <li><a className="hover:text-gray-300 transition duration-300" href="/">Inicio</a></li>
            <li><a className="hover:text-gray-300 transition duration-300" href="/about">Acerca de</a></li>
            <li><a className="hover:text-gray-300 transition duration-300" href="/contact">Contacto</a></li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;

